/* eslint-disable no-lone-blocks */
// /* eslint-disable no-unused-vars */
import React from 'react';
import { BrowserRouter , Switch } from 'react-router-dom';
// import logo from './logo.svg';
import './App.css';
import Navbar from './layouts/Navbar';
import LoginPage from './pages/LoginPage';
import HomePage from './pages/Home';
import AttendencePage from './pages/AttendencePage';
import PrivateRoute from './hoc/PrivateRoute';
import UnprivateRoute from './hoc/UnprivateRoute';
function App(props) {
	return (
		<BrowserRouter>
			<div className='h-100'>
				<div className='row h-100'>
					{/* Navbar  */}
					<div className='col-md-12 navbar-div'>
						<Navbar  {...props}/>
					</div>
					{/* Body  */}
					<div className='col-md-12 body-div'>
						<Switch>
							<UnprivateRoute exact path='/' component={LoginPage} {...props} />
							<UnprivateRoute exact path='/attendence-sheet' component={LoginPage} {...props} />
							<PrivateRoute exact path='/home'{...props} component={HomePage}/>
						</Switch>
					</div>
					{/* Footer  */}
				</div>
			</div>
		</BrowserRouter>
	);
}

export default App;
